WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Hej!

WordPress har en indbygget funktion, der registrerer, når et plugin eller et tema er skyld i en fejl på dit websted, og giver dig besked gennem denne automatiserede e-mail.
###CAUSE###
Som det første, skal du besøge dit websted (###SITEURL###) og se efter, om der skulle være synlige problemer. Som det næste, skal du besøge den side, hvor fejlen blevet fundet (###PAGEURL###) og se efter, om der skulle være synlige problemer.

###SUPPORT###

Hvis din side ser ud til at være i stykker, og du ikke har adgang til dit kontrolpanel som normalt, har WordPress nu en særlig "gendannelsestilstand". Denne lader dig logge sikkert ind i kontrolpanelet, så du kan undersøge fejlen nærmere.

###LINK###

For at holde din side sikker, vil dette link udløbe om ###EXPIRES###. Bare rolig. hvis fejlen opstår igen efter dette tidspunkt, vil der blive sendt en ny e-mail til dig.

Hvis du beder om hjælp til dette problem, vil der måske blive spurgt efter noget af følgende information:
