eord. Denne skabelon vil fungerer som erstatning, når der ikke kan findes en mere specifik skabelon (fx Nøgleord: Pizza).','Template nameTag'=>'Tag','Displays a post archive when a specific date is visited (e.g., example.com/2023/).'=>'Viser et indholdsarkiv, når en specifik dato besøges (fx eksempel.dk/2023/).','Template nameDate'=>'Dato','Displays a custom taxonomy archive. Like categories and tags, taxonomies have terms which you use to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g, Taxonomy: Art) cannot be found.'=>'Viser et arkiv for en tilpasset klassificering. Som kategorier og nøgleord har andre taksonomier termer, du kan bruge til at klassificere ting. For eksempel kan en taksonomi "Kunst" have flere termer som "Moderne" og "18. århundrede". Denne skabelon vil fungere som erstatning, når en mere specifik skabelon (fx: Taksonomi: Kunst) ikke findes.','Template nameTaxonomy'=>'Taksonomi','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g., Category: Recipes) cannot be found.'=>'Viser en post kategori arkiv. Denne skabelon vil fungere som en reserve, når en mere specifik skabelon (f.eks. Kategori: Opskrifter) ikke kan findes.','Template nameCategory'=>'Kategori','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g., Author: Admin) cannot be found.'=>'Viser en enkelt forfatters indlægsarkiv. Denne skabelon fungerer som en reserve, når en mere specifik skabelon (f.eks. Forfatter: Admin) ikke kan findes.','Template nameAuthor'=>'Forfatter','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g., Category or Tag) cannot be found.'=>'Viser ethvert arkiv, inklusiv indlæg af en enkelt forfatter, kategori, tag, taksonomi, tilpasset indlægstype og dato. Denne skabelon fungerer som en reserve, når mere specifikke skabeloner (f.eks. Kategori eller Tag) ikke kan findes.','Template nameArchive'=>'Arkiv','Display all static pages unless a custom template has been applied or a dedicated template exists.'=>'Viser alle statiske sider, medmindre en tilpasset skabelon er anvendt eller der findes en dedikeret skabelon.','Template namePage'=>'Side','Displays single posts on your website unless a custom template has been applied to that post or a dedicated template exists.'=>'Viser et enkelt indlæg på dit websted, medmindre en tilpasset skabelon er anvendt eller der findes en dedikeret skabelon.','Template nameSingle'=>'Enkelt','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g., Single Post, Page, or Attachment) cannot be found.'=>'Viser enhver enkelt post, såsom et indlæg eller en side. Denne skabelon fungerer som en reserve, når en mere specifik skabelon (f.eks. enkelt indlæg, side eller vedhæftet fil) ikke kan findes.','Template nameSingular'=>'Ental','Displays your site\'s front page, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'Viser dit websteds forside, uanset om den er indstillet til at vise seneste indlæg eller en statisk side. Forsideskabelonen har forrang over alle skabeloner.','Template nameFront Page'=>'Forside','Displays the latest posts as either the site homepage or a custom page defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the front page.'=>'Viser de seneste indlæg enten som webstedets forside eller en tilpasset side defineret under indstilling for Læsning. Hvis den findes, vil Forside-skabelonen overstyre denne skabelon, når der vises indlæg på forsiden.','Template nameHome'=>'Forside','Used as a fall